import React from "react";

class Tv extends React.Component {
  state = {
    movieID: ""
  };

  componentDidMount() {
    const { movieID } = this.props.match.params;
    this.setState(() => {
      return {
        movieID: movieID
      };
    });
  }

  render() {
    return (
      <div
        style={{ display: "grid", gridTemplateColumns: "1.2fr 8fr 1.2fr" }}
      ></div>
    );
  }
}

export default Tv;
